import React, { useState } from "react";
import { Link } from "react-router-dom";
import { Button } from "../../components/common/button/btn";
import Layout from "../../constant/layout/layout";
import {LoginModal} from "../modal";

const Index = () => {
  const [open, setOpen] = useState(false);
  return (
    <div className=''>
        <h3></h3>
      <div>

        <Button onClick={() => setOpen(!open)}>Login</Button>
        <Button onClick={() => setOpen(!open)}>SignUp</Button>
    </div>
      <div
        className={`${
          open ? "flex" : "hidden"
                  } fixed top-0 right-0 z-20 w-full bg-transparent h-screen grid
         grid-cols-1 items-center justify-items-center`}
      >
        <LoginModal setOpen={setOpen} />
      </div>
    </div>
  );
};

export default Index;
